// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity 0.8.4;

/// @notice DUSD Token used for testnet
contract DUSD {
    // --- Math ---
    function add(uint x, uint y) internal pure returns (uint z) {
        require((z = x + y) >= x);
    }
    function sub(uint x, uint y) internal pure returns (uint z) {
        require((z = x - y) <= x);
    }

    // --- ERC20 Data ---
    string public constant name     = "Derify BUSD";
    string public constant symbol   = "BUSD";
    string public constant version  = "1.0";
    uint8  public constant decimals = 18;

    uint256 _totalSupply      = 1000000000e18;  //1 billion USDT
    mapping (address => uint256)                   _balances;
    mapping (address => mapping (address => uint)) _allowances;
    mapping (address => uint256)                   _nonces;

    /// @notice Address which may mint new tokens
    address public minter;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    event MinterChanged(address minter, address newMinter);

    constructor(address account, address minter_) {
        _balances[account] = _totalSupply;
        emit Transfer(address(0), account, _totalSupply);
        minter = minter_;
        emit MinterChanged(address(0), minter);
    }

    function totalSupply() external view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) external view returns (uint256) {
        return _balances[account];
    }

    function allowance(address owner, address spender) external view returns (uint256) {
        return _allowances[owner][spender];
    }

    function setMinter(address minter_) external {
        require(msg.sender == minter, "DUSD::setMinter: only the minter can change the minter address");
        emit MinterChanged(minter, minter_);
        minter = minter_;
    }

    function mint(address dst, uint amount) external {
        require(msg.sender == minter, "DUSD::mint: only the minter can mint");
        require(dst != address(0), "DUSD::mint: cannot transfer to the zero address");

        // mint the amount
        _totalSupply = add(_totalSupply, amount);

        // transfer the amount to the recipient
        _balances[dst] = add(_balances[dst], amount);
        emit Transfer(address(0), dst, amount);
    }

    function approve(address spender, uint256 amount) external returns (bool) {
        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function transfer(address recipient, uint256 amount) external returns (bool) {
        require(_balances[msg.sender] >= amount, "DUSD/insufficient-balance");
        _balances[msg.sender] = sub(_balances[msg.sender], amount);
        _balances[recipient] = add(_balances[recipient], amount);
        emit Transfer(msg.sender, recipient, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool) {
        require(_balances[sender] >= amount, "DUSD/insufficient-balance");
        if (sender != msg.sender && _allowances[sender][msg.sender] != type(uint).max) {
            require(_allowances[sender][msg.sender] >= amount, "DUSD/insufficient-allowance");
            _allowances[sender][msg.sender] = sub(_allowances[sender][msg.sender], amount);
        }
        _balances[sender] = sub(_balances[sender], amount);
        _balances[recipient] = add(_balances[recipient], amount);
        emit Transfer(sender, recipient, amount);
        return true;
    }
}
